load-faction-test(node: class benchmark-test)
begin
if the class of phaction is faction then call pass(node)
else call fail(node, "The class of a loaded faction is [the class of phaction]");
end

create-faction-test(node: class benchmark-test)
Thing: class item;
begin
create an instance Thing of the class named by the symbol faction;
if the class of Thing is faction then call pass(node)
else call fail(node, "The class of a created faction is [the class of Thing]"); 
end

delete-faction-test(node: class benchmark-test)
Thing: class item;
begin
create an instance Thing of the class named by the symbol faction; 
delete Thing;
delete faction1 without permanence checks;
if Thing exists then call fail(node, "created instance was not deleted")
else if faction1 exists then call fail(node, "loaded instance was not deleted")
else call pass(node);
end

delete-members-test(node: class benchmark-test)
del: truth-value;
begin
del = call delete-a-member();
delete the subworkspace of faction2 without permanence checks; 
if del is false then call fail(node, "faction member was not deleted")
else if the subworkspace of faction2 exists then call fail(node, "faction subworkspace was not deleted")
else call pass(node); 
end

delete-a-member() = (truth-value)
begin
delete faction2-cp1 without permanence checks;
if faction2-cp1 exists then return false
else return true; 
end

faction-of-test(node: class benchmark-test)
surname: symbol;
begin
surname = call get-name();
if surname is faction3 then call pass(node)
else call fail(node,"[surname]");
end

main-faction-test(node: class benchmark-test)
begin
if this faction exists then call fail(node, "MAIN-FACTION is not nil")
else call pass(node);
end

does-not-lock-test(node: class benchmark-test)
t1: quantity;
t2: quantity;
f4p: truth-value;
begin
t1 = the current real time;
call test-busy-wait();
t2 = the current real time;
f4p = call f4-par-getter();
if f4p is false then call fail(node, "Faction proc was not run, did not finish or faction executed in more than 1 thread")
else if (t2 - t1) > 3 seconds then call fail(node, "G2 was locked")
else call pass(node);
end

faction4-busy-wait()
t1: quantity;
lock-up: quantity = 10 seconds;
begin
t1 = the current real time;
post "FBW1 [t1]";
repeat
exit if the current real time >= t1+lock-up;
end;
post "FBW2 [the current real time]";
conclude that faction4-par is true;
end

test-busy-wait()
begin
post "TBW1 [the current real time]";
spawn faction4-busy-wait();
post "TBW2 [the current real time]";
end

same-faction-spawn-test(node: class benchmark-test)
begin
spawn pawn();
wait for 1 second;
if lp is false then call fail(node, "procedure was not called")
else call pass(node); 
end

future-task-test(node: class benchmark-test)
t1: quantity;
t2: quantity;
begin
t1 = the current real time;
start faction4-busy-wait() after 5 seconds;
wait for 7 seconds;
t2 = the current real time; 
if (t2 - t1) > 9 seconds then call fail(node, "G2 was locked")
else call pass(node);
end
